description:
In Paris, a young employee in the office of the US Ambassador hooks up with an American spy looking to stop a terrorist attack in the city.

James Reece, personal aide to the U.S. Ambassador to France, is secretly moonlighting as a low-level CIA operative. Looking for more action, Reece accepts a job that teams him with wise-cracking special agent Charlie Wax, a trigger-happy loose cannon sent to Paris on a mission of international importance. Now, Reece finds himself on the wildest ride of his life as the new partners pull out all the stops to annihilate the enemy...
